pinTooltip = false;

	var currentMousePos = { x: -1, y: -1 };
	$(document).mousemove(function(event) {
			currentMousePos.x = event.pageX;
			currentMousePos.y = event.pageY;
	});


d3.select("#outerFrame").attr({
	height: $(window).height()
})

current_button = null;
bundles = {
	insulin: [],
	fatty_acids: [],
	glucose: [],
	lactate: []
};
line_counter = 0;

var scaleH = $(window).height()/610,
		scaleW = $(window).width()/850;
		scale = scaleH < scaleW ? scaleH : scaleW;

d3.select("#resize").attr({
	transform: "scale("+scale+")"
})

if (scale < 0.5) {
	d3.select("html, body").style({
		"font-size": "9px"
	})
} else if (scale > 1.8) {
	d3.select("html, body").style({
		"font-size": "20px"
	})
} 



data = [];
mousepoints = [];
stuff = [];
reverse_lookup = {};

d3.csv("/assets/data/snapshot_data_new.csv", function(d) {
	data.push(d);
	reverse_lookup[d.id] = d;
}, function(error) {
	var i = 0;

// important phosphosite location stuff here
	console.log(data[i].name + " " + data[i].phosphosite);

	d3.select("#tooltip_mask").on("click",function(d){
		var point = d3.mouse(this)
		mousepoints.push(point);

		stuff.push({
			PMID: data[i].PMID,
			comment: data[i].comment,
			id: data[i].id,
			name: data[i].name,
			phosphosite: data[i].phosphosite,
			uniprot: data[i].uniprot,
			point: point
		})

// important phosphosite location stuff here
		console.log(data[++i].name + " " + data[i].phosphosite);
	});


});

k_table = {};
d3.csv("/assets/data/kinases.csv", function(d) {
	k_data.push(d);
}, function(error){
	k_data.forEach(function(d){
		k_table[d.phosphosites] = d.group;
	})
})

s_data = [];
s_table = {};
d3.csv("/assets/data/substrates.csv", function(d) {

}, function(error){
	s_data.forEach(function(d){

	})

t only de-represses glycogen synthesis (<a href='http://pubmed.org/8816781' target='_blank' title='Open in PubMed'>Eldar-Finkelman et al., 1996</a>), for which GSK3 is named, but influences a wide range of cellular processes (reviewed in <a href='http://pubmed.org/11579232' target='_blank' title='Open in PubMed'>Woodgett, 2001</a>).","id":"4288","name":"GSK3b","phosphosite":"S9","uniprot":"Q9WV60","point":[215.0851593017578,248.86456298828125]},{"PMID":"6249596, 6772446, 7759494, 8226927, 14745035, 22248338","comment":"GSK3 phosphorylates Gys at consecutive serines (S641, S645, S649, S653) in a C->N direction (<a href='http://pubmed.org/6249596' target='_blank' title='Open in PubMed'>Embi et al., 1980</a>; <a href='http://pubmed.org/6772446' target='_blank' title='Open in PubMed'>Rylatt et al., 1980</a>). Once S641 is phosphorylated, Gys activity is reduced, now depending on glucose-6-phosphate for allosteric activation (<a href='http://pubmed.org/7759494' target='_blank' title='Open in PubMed'>Skurat & Roach, 1995</a>; <a href='http://pubmed.org/8226927' target='_blank' title='Open in PubMed'>Wang & Roach, 1993</a>). Upon insulin stimulation, GSK3 is inhibited, de-repressing Gys and thus stimulating glycogen synthesis (<a href='http://pubmed.org/14745035' target='_blank' title='Open in PubMed'>Schafer et al., 2004</a>; <a href='http://pubmed.org/22248338' target='_blank' title='Open in PubMed'>Roach et al., 2012</a>).","id":"5572","name":"Gys","phosphosite":"S641","uniprot":"Q9Z1E4","point":[400.52716064453125,457.05596923828125]},{"PMID":"6249596, 6772446, 7759494, 8226927, 14745035, 22248338","comment":"GSK3 phosphorylates Gys at consecutive serines (S641, S645, S649, S653) in a C->N direction (<a href='http://pubmed.org/6249596' target='_blank' title='Open in PubMed'>Embi et al., 1980</a>; <a href='http://pubmed.org/6772446' target='_blank' title='Open in PubMed'>Rylatt et al., 1980</a>). Once S641 is phosphorylated, Gys activity is reduced, now depending on glucose-6-phosphate for allosteric activation (<a href='http://pubmed.org/7759494' target='_blank' title='Open in PubMed'>Skurat & Roach, 1995</a>; <a href='http://pubmed.org/8226927' target='_blank' title='Open in PubMed'>Wang & Roach, 1993</a>). Upon insulin stimulation, GSK3 is inhibited, de-repressing Gys and thus stimulating glycogen synthesis (<a href='http://pubmed.org/14745035' target='_blank' title='Open in PubMed'>Schafer et al., 2004</a>; <a href='http://pubmed.org/22248338' target='_blank' title='Open in PubMed'>Roach et al., 2012</a>).","id":"5575","name":"Gys","phosphosite":"S649","uniprot":"Q9Z1E4","point":[232.31954956054688,457.05596923828125]},{"PMID":"8940068, 12917326","comment":"In response to growth factors, MAPK phosphorylates HSF1 at S307, which primes GSK3 to phosphorylate at S303 (<a href='http://pubmed.org/8940068' target='_blank' title='Open in PubMed'>Chu et al., 1996</a>). This promotes 14-3-3 binding, sequestering HSF1 in the cytoplasm and thus repressing its transcriptional activity (<a href='http://pubmed.org/12917326' target='_blank' title='Open in PubMed'>Wang et al., 2003</a>). This represses the heat shock response during processes stimulated by growth-factors, such as cellular proliferation.","id":"6241","name":"HSF1","phosphosite":"S303","uniprot":"P38532","point":[423.9659423828125,400.52716064453125]},{"PMID":"8940068, 12917326","comment":"In response to growth factors, MAPK phosphorylates HSF1 at S307, which primes GSK3 to phosphorylate at S303 (<a href='http://pubmed.org/8940068' target='_blank' title='Open in PubMed'>Chu et al., 1996</a>). This promotes 14-3-3 binding, sequestering HSF1 in the cytoplasm and thus repressing its transcriptional activity (<a href='http://pubmed.org/12917326' target='_blank' title='Open in PubMed'>Wang et al., 2003</a>). This represses the heat shock response during processes stimulated by growth-factors, such as cellular proliferation.","id":"6242","name":"HSF1","phosphosite":"S307","uniprot":"P38532","point":[352.96026611328125,401.216552734375]},{"PMID":"22768106","comment":"In response to stresses such as heat shock, mTORC1 phosphorylates HSF1 at S326, leading to the upregulation of heat-shock proteins such as Hsp70 (<a href='http://pubmed.org/22768106' target='_blank' title='Open in PubMed'>Chou et al., 2012</a>).","id":"6246","name":"HSF1","phosphosite":"S326","uniprot":"P38532","point":[199.22952270507812,402.5953063964844]},{"PMID":"9417067, 19018281","comment":"PKA phosphorylates HSL at several residues (<a href='http://pubmed.org/9417067' target='_blank' title='Open in PubMed'>Anthonsen et al., 1998</a>; <a href='http://pubmed.org/19018281' target='_blank' title='Open in PubMed'>Krintel et al., 2008</a>). This results in activation of HSL, promoting lipolysis and thus mobilisation of energy stores during exercise or starvation.","id":"10671","name":"Hsl","phosphosite":"S559","uniprot":"Q8CDI9","point":[473.6009826660156,410.1784362792969]},{"PMID":"2537200","comment":"PKA phosphorylates HSL at several residues (<a href='http://pubmed.org/9417067' target='_blank' title='Open in PubMed'>Anthonsen et al., 1998</a>; <a href='http://pubmed.org/19018281' target='_blank' title='Open in PubMed'>Krintel et al., 2008</a>). This results in activation of HSL, promoting lipolysis and thus mobilisation of energy stores during exercise or starvation.","id":"10670","name":"Hsl","phosphosite":"S557","uniprot":"Q8CDI9","point":[543.9172973632812,410.1784362792969]},{"PMID":"2449432, 3166375, 2158467, 1658004","comment":"Upon binding insulin, the insulin receptor phosphorylates itself at mouse Y1175, Y1179, Y1180 (human Y1185, Y1189, and Y1190), both in vitro and in vivo (<a href='http://pubmed.org/2449432' target='_blank' title='Open in PubMed'>White et al., 1988</a>; <a href='http://pubmed.org/3166375' target='_blank' title='Open in PubMed'>Tavar & Denton, 1988</a>; <a href='http://pubmed.org/2158467' target='_blank' title='Open in PubMed'>Kruszynska et al., 1990< oint":[265.4095764160156,144.07948303222656]},{"PMID":"16914728, 17579213","comment":"Following insulin stimulation, S522 of IRS-1 is phosphorylated by S6K (<a href='http://pubmed.org/16914728' target='_blank' title='Open in PubMed'>Shah & Hunter, 2006</a>), which reduces tyrosine phosphorylation of IRS-1 (<a href='http://pubmed.org/17579213' target='_blank' title='Open in PubMed'>Giraud et al., 2007</a>). This provides a feedback loop that regulates insulin signalling.","id":"23681","name":"Irs1","phosphosite":"S522","uniprot":"Q543V3","point":[639.740478515625,184.7526397705078]},{"PMID":"7504175, 8196603, 7935386","comment":"Upon insulin stimulation, IRS-1 is phosphorylated by the insulin receptor at numerous tyrosine residues. These serve as docking sites for SH2-binding proteins. From the phosphosites shown, Y680 (and Y460 to some extent) bind the p85 subunit of PI3K (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>), mediating the PI3K/Akt pathway; Y891 binds GRB2 to activate Ras/MAPK (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>; <a href='http://pubmed.org/8196603' target='_blank' title='Open in PubMed'>Myers et al., 1994</a>); Y1173 binds SHPTP2 to also activate Ras/MAPK (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>; <a href='http://pubmed.org/7935386' target='_blank' title='Open in PubMed'>Noguchi et al., 1994</a>). Thus, IRS-1 acts as a divergence point, stimulating multiple signalling pathways in response to insulin.","id":"37636","name":"Irs1","phosphosite":"Y891","uniprot":"Q543V3","point":[127.53446960449219,179.927001953125]},{"PMID":"7504175, 8196603, 7935386","comment":"Upon insulin stimulation, IRS-1 is phosphorylated by the insulin receptor at numerous tyrosine residues. These serve as docking sites for SH2-binding proteins. From the phosphosites shown, Y680 (and Y460 to some extent) bind the p85 subunit of PI3K (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>), mediating the PI3K/Akt pathway; Y891 binds GRB2 to activate Ras/MAPK (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>; <a href='http://pubmed.org/8196603' target='_blank' title='Open in PubMed'>Myers et al., 1994</a>); Y1173 binds SHPTP2 to also activate Ras/MAPK (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>; <a href='http://pubmed.org/7935386' target='_blank' title='Open in PubMed'>Noguchi et al., 1994</a>). Thus, IRS-1 acts as a divergence point, stimulating multiple signalling pathways in response to insulin.","id":"37639","name":"Irs1","phosphosite":"Y460","uniprot":"Q543V3","point":[104.78507995605469,181.30575561523438]},{"PMID":"7504175, 8196603, 7935386","comment":"Upon insulin stimulation, IRS-1 is phosphorylated by the insulin receptor at numerous tyrosine residues. These serve as docking sites for SH2-binding proteins. From the phosphosites shown, Y608 (and Y460 to some extent) bind the p85 subunit of PI3K (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>), mediating the PI3K/Akt pathway; Y891 binds GRB2 to activate Ras/MAPK (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>; <a href='http://pubmed.org/8196603' target='_blank' title='Open in PubMed'>Myers et al., 1994</a>); Y1173 binds SHPTP2 to also activate Ras/MAPK (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>; <a href='http://pubmed.org/7935386' target='_blank' title='Open in PubMed'>Noguchi et al., 1994</a>). Thus, IRS-1 acts as a divergence point, stimulating multiple signalling pathways in response to insulin.","id":"37640","name":"Irs1","phosphosite":"Y608","uniprot":"Q543V3","point":[356.4071350097656,178.5482635498047]},{"PMID":"7504175, 8196603, 7935386","comment":"Upon insulin stimulation, IRS-1 is phosphorylated by the insulin receptor at numerous tyrosine residues. These serve as docking sites for SH2-binding proteins. From the phosphosites shown, Y608 (and Y460 to some extent) bind the p85 subunit of PI3K (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>), mediating the PI3K/Akt pathway; Y891 binds GRB2 to activate Ras/MAPK (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>; <a href='http://pubmed.org/8196603' target='_blank' title='Open in PubMed'>Myers et al., 1994</a>); Y1173 binds SHPTP2 to also activate Ras/MAPK (<a href='http://pubmed.org/7504175' target='_blank' title='Open in PubMed'>Sun et al., 1993</a>; <a href='http://pubmed.org/7935386' target='_blank' title='Open in PubMed'>Noguchi et al., 1994</a>). Thus, IRS-1 acts as a divergence point, stimulating multiple signalling pathways in response to insulin.","id":"37643","name":"Irs1","phosphosite":"Y1173","uniprot":"Q543V3","point":[160.62449645996094,178.5482635498047]},{"PMID":"12761204","comment":"SGK1 phosphorylates MEKK3 (MAP3K3) on S337 (and S166), reducing its kinase activity (<a href='http://pubmed.org/12761204' target='_blank' title='Open in PubMed'>Chun et al., 2003</a>). Since MEKK3 regulates the stress-activated (SAPK) and mitogen-activated (MAPK) protein kinase pathways, this provides a way for SGK1 to turn off these pathways, enabling cross-talk between kinase signalling pathways.","id":"1816","name":"Mekk3","phosphosite":"S337","uniprot":"Q61084","point":[395.7015380859375,393.6334228515625]},{"PMID":"11994045, 15568999, 9687510","comment":"The mitogen- and stress-activated kinase 1 (MSK1) is initially phosphorylated by p38 MAPK and ERK1 (<a href='http://pubmed.org/11994045' target='_blank' title='Open in PubMed'>Markou & Lazou, 2002</a>; <a href='http://pubmed.org/15568999' target='_blank' title='Open in PubMed'>McCoy et al., 2005</a>), including at residue T645 (human T581), this enables MSK1 to autophosphorylate: the C-terminal kinase domain phosphorylates itself at several sites, including the hydrophobic motif at S375 (human S376). This activates the N-terminal kinase domain, enabling MSK1 to phosphorylate its substrates (<a href='http://pubmed.org/15568999' target='_blank' title='Open in PubMed'>McCoy et al., 2005</a>). This enables the cell to respond to both growth factors and cellular stress through the same kinase (e.g., <a href='http://pubmed.org/9687510' target='_blank' title='Open in PubMed'>Deak et al., 1998</a>).","id":"11092","name":"MSK1","phosphosite":"S375","uniprot":"Q8C050","point":[493.5928649902344,447.4046936035156]},{"PMID":"10702316, 20022946","comment":"Upon activation, mTOR autophosphorylates itself at S2481 (<a href='http://pubmed.org/10702316' target='_blank' title='Open in PubMed'>Peterson et al., 2000</a>), being observed in both complexes mTORC1 and mTORC2 (<a href='http://pubmed.org/20022946' target='_blank' title='Open in PubMed'>Soliman et al., 2010</a>). Although diagnostic of mTOR activity, the physiological significance of this autophosphorylation site remains elusive.","id":"11843","name":"mTOR","phosphosite":"S2481","uniprot":"Q9JLN9","point":[552.1897583007812,455.6772155761719]},{"PMID":"10702316, 20022946","comment":"Upon activation, mTOR autophosphorylates itself at S2481 (<a href='http://pubmed.org/10702316' target='_blank' title='Open in PubMed'>Peterson et al., 2000</a>), being observed in both complexes mTORC1 and mTORC2 (<a href='http://pubmed.org/20022946' target='_blank' title='Open in PubMed'>Soliman et al., 2010</a>). Although diagnostic of mTOR activity, the physiological significance of this autophosphorylation site remains elusive.","id":"11843a","name":"mTOR","phosphosite":"S2481","uniprot":"Q9JLN9","point":[547.3641357421875,489.45660400390625]},{"PMID":"10910062, 10567225, 15899889, 15905173, 19145465","comment":"Originally considered an Akt target (<a href='http://pubmed.org/10910062' target='_blank' title='Open in PubMed'>Sekuli et al., 2000</a>; <a href='http://pubmed.org/10567225' target='_blank' title='Open in PubMed'>Nav et al., 1999</a>), more recent evidence suggests that S2448 is actually phosphorylated by p70-S6K (<a href='http://pubmed.org/15899889' target='_blank' title='Open in PubMed'>Chiang & Abraham, 2005</a>; <a href='http://pubmed.org/15905173' target='_blank' title='Open in PubMed'>Holz & Blenis, 2005</a>). This presents a feedback loop, although its function has not been elucidated. Since S2448 lies within the repressor domain, it has been speculated that phosphorylation at this site represses mTOR activity (<a href='http://pubmed.org/10910062' target='_blank' title='Open in PubMed'>Sekuli et al., 2000</a>), but does not affect mTORC1 complex formation (<a href='http://pubmed.org/19145465' target='_blank' title='Open in PubMed'>Rosner et al., 2010</a>).","id":"11851","name":"mTOR","phosphosite":"S2448","uniprot":"Q9JLN9","point":[457.05596923828125,488.7672424316406]},{"PMID":"15461589, 20416281","comment":"SGK kinases phosphorylate T328, S330, T346, T356, and T366 of NDRG1 (the latter three found within a triple 10-residue repeat sequence) (<a href='http://pubmed.org/15461589' target='_blank' title='Open in PubMed'>Murray et al., 2004</a>; <a href='http://pubmed.org/20416281' target='_blank' title='Open in PubMed'>Murakami et al., 2010</a>). This primes NDRG1 for phosphorylation by GSK3 (<a href='http://pubmed.org/15461589' target='_blank' title='Open in PubMed'>Murray et al., 2004</a>). Phosphorylation of NDRG1 influences its role in stress responses, such as the suppression of NF-Kb signalling and CXC chemokine production (<a href='http://pubmed.org/20416281' target='_blank' title='Open in PubMed'>Murakami et al., 2010</a>).","id":"4497","name":"Ndrg1","phosphosite":"S330","uniprot":"Q62433","point":[599.7567138671875,276.4395751953125]},{"PMID":"15461589, 20416281","comment":"SGK kinases phosphorylate T328, S330, T346, T356, and T366 of NDRG1 (the latter three found within a triple 10-residue repeat sequence) (<a href='http://pubmed.org/15461589' target='_blank' title='Open in PubMed'>Murray et al., 2004</a>; <a href='http://pubmed.org/20416281' target='_blank' title='Open in PubMed'>Murakami et al., 2010</a>). This primes NDRG1 for phosphorylation by GSK3 (<a href='http://pubmed.org/15461589' target='_blank' title='Open in PubMed'>Murray et al., 2004</a>). Phosphorylation of NDRG1 influences its role in stress responses, such as the suppression of NF-Kb signalling and CXC chemokine production (<a href='http://pubmed.org/20416281' target='_blank' title='Open in PubMed'>Murakami et al., 2010</a>).","id":"31569","name":"Ndrg1","phosphosite":"T366","uniprot":"Q62433","point":[596.309814453125,404.6634216308594]},{"PMID":"15461589","comment":"SGK kinases phosphorylate T330, S332, and T348 of NDRG2 - there is some evidence that this primes NDRG2 for phosphorylation by GSK3 (<a href='http://pubmed.org/15461589' target='_blank' title='Open in PubMed'>Murray et al., 2004</a>). The functional consequences of this have not been well studied.","id":"32167","name":"Ndrg2","phosphosite":"T330","uniprot":"Q9QYG0","point":[423.27655029296875,281.95458984375]},{"PMID":"15461589","comment":"SGK kinases phosphorylate T330, S332, and T348 of NDRG2 - there is some evidence that this primes NDRG2 for phosphorylation by GSK3 (<a href='http://pubmed.org/15461589' target='_blank' title='Open in PubMed'>Murray et al., 2004</a>). The functional consequences of this have not been well studied.","id":"32169","name":"Ndrg2","phosphosite":"T348","uniprot":"Q9QYG0","point":[616.3016967773438,302.6358642578125]},{"PMID":"7489717, 7545671, 9632736","comment":"mTORC1 phosphorylates p70S6K at T412 (<a href='http://pubmed.org/7489717' target='_blank' title='Open in PubMed'>Pearson et al., 1995</a>; <a href='http://pubmed.org/7545671' target='_blank' title='Open in PubMed'>Han et al., 1995</a>), found within a hydrophobic motif downstream of the catalytic domain. This promotes p70S6K to phosphorylate numerous proteins (e.g., Eif4b) to initiate protein synthesis. As pT412 was absent in our phosphoproteomic dataset (<a href='http://pubmed.org/23684622' target='_blank' title='Open in PubMed'>Humphrey et al., 2013</a>), for illustrative purposes we have used data on pT444, both of which are mTORC1-regulated sites (<a href='http://pubmed.org/21659604' target='_blank' title='Open in PubMed'>Hsu et al., 2011</a>) and respond with similar kinetics to insulin in adipocytes (<a href='http://pubmed.org/23684622' target='_blank' title='Open in PubMed'>Humphrey et al., 2013</a>).","id":"34999","name":"p70S6K","phosphosite":"T412","uniprot":"Q8BSK8","point":[269.54583740234375,417.7615661621094]},{"PMID":"9430688","comment":"MAPK/ERK phosphorylates p90(RSK) at several residues, including S352 (<a href='http://pubmed.org/9430688' target='_blank' title='Open in PubMed'>Dalby et al., 1998</a>). This residue is found within the N-terminal kinase domain, contributing to the activation of p90(RSK).","id":"1212","name":"p90RSK","phosphosite":"S352","uniprot":"Q3TIM6","point":[574.9391479492188,500.48663330078125]},{"PMID":"10454575, 12453887","comment":"Promotes 14-3-3 binding and increased Pde3b activity (<a href='http://pubmed.org/10454575' target='_blank' title='Open in PubMed'>Kitamura et al., 1999</a>; <a href='http://pubmed.org/12453887' target='_blank' title='Open in PubMed'>Onuma et al., 2002</a>). Pde3b catalyses hydrolysis of cAMP, influencing cAMP-dependent processes. For instance, this deactivates hormone-sensitive lipase and lipolysis in adipocytes.","id":"25879","name":"Pde3b","phosphosite":"S273","uniprot":"B2RWU9","point":[726.601806640625,378.4671630859375]},{"PMID":"9211863, 12853467, 20958264","comment":"There is strong evidence to suggest that PFKFB2 (cardiac PFK-2) is phosphorylated at S469 and S486 by Akt, leading to 14-3-3 binding and increased activity (<a href='http://pubmed.org/9211863' target='_blank' title='Open in PubMed'>Deprez et al., 1997</a>; <a href='http://pubmed.org/12853467' target='_blank' title='Open in PubMed'>Pozuelo et al., 2003</a>; <a href='http://pubmed.org/20958264' target='_blank' title='Open in PubMed'>Moon et al., 2011</a>). This elevates levels of its product, fructose-2,6-bisphosphate, which stimulates glycolysis.","id":"7476","name":"Pfkfb2","phosphosite":"S469","uniprot":"P70265","point":[520.478515625,169.5863800048828]},{"PMID":"9211863, 12853467, 20958264","comment":"There is strong evidence to suggest that PFKFB2 (cardiac PFK-2) is phosphorylated at S469 and S486 by Akt, leading to 14-3-3 binding and increased activity (<a href='http://pubmed.org/9211863' target='_blank' title='Open in PubMed'>Deprez et al., 1997</a>; <a href='http://pubmed.org/12853467' target='_blank' title='Open in PubMed'>Pozuelo et al., 2003</a>; <a href='http://pubmed.org/20958264' target='_blank' title='Open in PubMed'>Moon et al., 2011</a>). This elevates levels of its product, fructose-2,6-bisphosphate, which stimulates glycolysis.","id":"7477","name":"Pfkfb2","phosphosite":"S486","uniprot":"P70265","point":[498.4184875488281,167.51824951171875]},{"PMID":"16488886, 17114792","comment":"Protein kinase A phosphorylates Plin1 (perilipin A) at S492, which promotes access of lipases to lipid droplets in adipocytes, leading to lipid droplet breakdown and lipolysis (<a href='http://pubmed.org/16488886' target='_blank' title='Open in PubMed'>Marcinkiewicz et al., 2006</a>; <a href='http://pubmed.org/17114792' target='_blank' title='Open in PubMed'>Miyoshi et al., 2007</a>). This serves to mobilise energy during fasting and exercise.","id":"9506","name":"Plin1","phosphosite":"S492","uniprot":"Q8CGN5","point":[636.9829711914062,394.3227844238281]},{"PMID":"12524439, 17386266, 17277771, 17517883, 20138985","comment":"Akt phosphorylates PRAS40 at T247 (<a href='http://pubmed.org/12524439' target='_blank' title='Open in PubMed'>Kovacina et al., 2003</a>; <a href='http://pubmed.org/17386266' target='_blank' title='Open in PubMed'>Sancak et al., 2007</a>; <a href='http://pubmed.org/17277771' target='_blank' title='Open in PubMed'>Vander et al., 2007</a>), which promotes mTORC1 to phosphorylate PRAS40 at multiple sites, including S184 (<a href='http://pubmed.org/20138985' target='_blank' title='Open in PubMed'>Nascimento et al., 2010</a>; <a href='http://pubmed.org/17517883' target='_blank' title='Open in PubMed'>Oshiro et al., 2007</a>). Together, these phosphorylation events cause PRAS40 to dissociate from mTORC1 and bind 14-3-3. Combined with Akt-mediated TSC2 phosphorylation, this results in mTORC1 activation.","id":"6505","name":"Pras40","phosphosite":"S184","uniprot":"Q9D1F4","point":[712.1248779296875,401.216552734375]},{"PMID":"12524439, 17386266, 17277771, 17517883, 20138985","comment":"Akt phosphorylates PRAS40 at T247 (<a href='http://pubmed.org/12524439' target='_blank' title='Open in PubMed'>Kovacina et al., 2003</a>; <a href='http://pubmed.org/17386266' target='_blank' title='Open in PubMed'>Sancak et al., 2007</a>; <a href='http://pubmed.org/17277771' target='_blank' title='Open in PubMed'>Vander et al., 2007</a>), which promotes mTORC1 to phosphorylate PRAS40 at multiple sites, including S184 (<a href='http://pubmed.org/20138985' target='_blank' title='Open in PubMed'>Nascimento et al., 2010</a>; <a href='http://pubmed.org/17517883' target='_blank' title='Open in PubMed'>Oshiro et al., 2007</a>). Together, these phosphorylation events cause PRAS40 to dissociate from mTORC1 and bind 14-3-3. Combined with Akt-mediated TSC2 phosphorylation, this results in mTORC1 activation.","id":"32018","name":"Pras40","phosphosite":"T247","uniprot":"Q9D1F4","point":[534.9553833007812,199.22952270507812]},{"PMID":"1939282","comment":"p70S6K phosphorylates RPS6 (S6), a component in the 40S ribosomal subunit, at several sites, including S236 and S240 (<a href='http://pubmed.org/1939282' target='_blank' title='Open in PubMed'>Ferrari et al., 1991</a>). Some studies indicate that this results in selective translation of a subset of mRNAs, 5'TOP mRNAs, (e.g., <a href='http://pubmed.org/9218810' target='_blank' title='Open in PubMed'>Jefferies et al., 1997</a>), but this remains controversial (e.g., <a href='http://pubmed.org/11972328' target='_blank' title='Open in PubMed'>Barth-Baus et al., 2002</a>; <a href='http://pubmed.org/16166381' target='_blank' title='Open in PubMed'>Ruvinsky et al., 2005</a>). There is also evidence that S236 phosphorylation promotes binding to the 7-methylguanosine cap-binding complex to initiate translation (<a href='http://pubmed.org/17360704' target='_blank' title='Open in PubMed'>Roux et al., 2007</a>), but studies have also shown that phosphorylation reduces protein synthesis, slows cell division, and increases cell size (e.g., <a href='http://pubmed.org/16166381' target='_blank' title='Open in PubMed'>Ruvinsky et al., 2005</a>). Thus, the physiological outcome of S6 phosphorylation remains unclear.","id":"1143","name":"Rps6","phosphosite":"S236","uniprot":"P62754","point":[177.1695098876953,437.7534484863281]},{"PMID":"1939282","comment":"p70S6K phosphorylates RPS6 (S6), a component in the 40S ribosomal subunit, at several sites, including S236 and S240 (<a href='http://pubmed.org/1939282' target='_blank' title='Open in PubMed'>Ferrari et al., 1991</a>). Some studies indicate that this results in selective translation of a subset of mRNAs, 5'TOP mRNAs, (e.g., <a href='http://pubmed.org/9218810' target='_blank' title='Open in PubMed'>Jefferies et al., 1997</a>), but this remains controversial (e.g., <a href='http://pubmed.org/11972328' target='_blank' title='Open in PubMed'>Barth-Baus et al., 2002</a>; <a href='http://pubmed.org/16166381' target='_blank' title='Open in PubMed'>Ruvinsky et al., 2005</a>). There is also evidence that S236 phosphorylation promotes binding to the 7-methylguanosine cap 		tt.transition().duration(250)

		})
	} else {
		console.log('tooltip pinned');
	}
}

	var path = coords.toString();
	var temp = d3.select("#Legend")
		.append("svg:path")
		.attr({
			id: "line-"+line_counter,
			class: "temp-line",
			d: path
		});
//	console.log(temp[0].getTotalLength());
	var len = document.getElementById("line-"+line_counter).getTotalLength();
	var thing = d3.select("#Legend")
      .append("circle")
        .attr("r", 1)
        .style("fill", color);
//        .data(path)
      thing.append("animateMotion")
      	.attr({
//      		id: "hello",
      		path: path,
      		rotate: "auto",
      		dur: len/10 + "s",
      		repeatCount: "indefinite"
      	})
      	
      thing.append("animate")
				.attr({
					attributeType: "CSS",
					attributeName: "opacity",
					from: "1",
					to: "0",
					dur: len/10 + "s",
					repeatCount: "indefinite"
				})
	line_counter++;
}

make_animations();
function make_animations(){
	hide_meta();
	meta_paths.insulin.forEach(function(d){
		animateLines(d, "#FB2778");
	})
	meta_paths.fatty_acids.forEach(function(d){
		animateLines(d, "#CCB078");
	})
	meta_paths.glucose.forEach(function(d){
		animateLines(d, "#EFAB53");
	})
	meta_paths.lactate.forEach(function(d){
		animateLines(d, "#95BCC6");
	})

}
